import "./Hotel.css";
import dataHotel from "../../data/hotel_list.json";

import React from "react";

function Hotel() {
  return (
    <>
      <h3 style={{ margin: "25px 0" }}>Browse by property type</h3>
      {dataHotel.map((item, index) => {
        return (
          <div key={index} className="items-hotel">
            <img src={item.image_url} alt="hotel" />
            <ul className="hotel-content">
              <li>{item.name}</li>
              <li>{item.city}</li>
              <li>Start from {item.price}</li>
              <li>
                <span>{item.rate}</span> {item.type}
              </li>
            </ul>
          </div>
        );
      })}
    </>
  );
}

export default Hotel;
